"use strict";function __user_getLists(){$.ajax({url:Global.API_URL+"/user.json",type:"GET",async:!0,dataType:"json",cache:!0,beforeSend:function(t){t.setRequestHeader("Authorization","Bearer "+localStorage.getItem("Token"))},error:function(t,e,a){},complete:function(t){var e=JSON.parse(t.responseText),a=[],s=1;for(var o in e)if(e.hasOwnProperty(o)){var l=e[o],n="<tr><th>"+s+'</th><td><a href="/getuser?id='+o+'">'+checkNull(l.fullname)+"</a></td><td>"+checkNull(l.email)+"</td><td>"+checkNull(l.username)+"</td></tr>";a.push(n),s++}$(".userlists").html('<table class="table-md table-striped table-hover"><thead> <tr> <th scope="col">#</th> <th scope="col">Họ và tên</th> <th scope="col">Email</th> <th scope="col">Username</th> </tr></thead><tbody></tbody></table>'),$("#pagination").pagination({dataSource:a,pageSize:5,ulClassName:"pagination",showPrevious:!1,showNext:!1,callback:function(t,e){var a=t;$(".userlists table tbody").html(a),$("#pagination li").each(function(){$(this).addClass("page-item").find("a").addClass("page-link")})}})}})}$(document).ready(function(){__user_getLists()});